import React from 'react';
import SignInButtons from './SignInButtons';
import SearchBar from './SearchBar';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (

    <div>
        <SearchBar />
        <Link to="/checkout">
        <Button variant="secondary">Checkout</Button>
        </Link>
        <SignInButtons />
    </div>

  );
};

export default NavBar;
